import React from "react";
import Typography from "@mui/material/Typography";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import CardActions from "@mui/material/CardActions";
import Carousel from "react-material-ui-carousel";
import { Paper, Button } from "@mui/material";

function ProfileCard() {
  return (
    <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        component={
          <Carousel>
            NextIcon=
            {<img src="./imgs/panitan-punpuang-G99Lrxmc-LA-unsplash.jpg" />}
            PrevIcon=
            {<img src="./imgs/brooke-cagle-TNglkSZMquE-unsplash.jpg" />}
          </Carousel>
        }
        // alt="green iguana"
        // height="140"
        // image="./imgs/panitan-punpuang-G99Lrxmc-LA-unsplash.jpg"
      />

      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          Inbar
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Random Modal
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Gals are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
    </Card>
  );
}

export default ProfileCard;
